import styled from 'styled-components';

const MySmallButton = styled.button`
  background-color: orange;
  color: black;
  font-size: 10px;
  padding: 4px 9px;
  border-radius: 3px;
  margin: 10px 0px;
  cursor: pointer;
`;

export default MySmallButton;
